const Menu = (props) => {
  return (
    <Card
      style={{
        width: "800px",
        height: "300px",
        margin: "auto",
        marginTop: "50px",
        marginBottom: "50px",
        backgroundColor: "#ccc",
      }}
    ></Card>
  );
};

export default Menu;
